- input: "TEXT\x1CC00213231\x1C.TEXT\x1C\x1CF3XA\x1CHello FEC Advisor, Please note
    that our total contribution to Congressman Boyd looks like it exceeds the $5,000
    limit by $500.  The situation is that a contribution to his campaign made on April
    7, 2009 in the amount of $3,000 was inadvertently designated as a 'General Election'
    contribution, but was, in fact, a 'Special Primary' contribution.  The second
    contribution to his campaign was made on September 30, 2010 in the amount of $2,500,
    which makes the total amount $5,500.  This discrepancy was caused by a clerical
    error on my part in not properly designating the first contribution as 'Special
    Primary.'  I have attempted to amend the 2009 Mid-Year report but am having technical
    problems with it.  I've spoken with my FEC advisor about this technical problem
    and she is helping me to get it solved.  I will be uploading the amended 2009
    Mid-Year report as soon as this problem is resolved.  Thank you for your consideration.
    \  Suzanne Eaton, Assistant Treasurer\n"
